import create, { UseStore, State } from "zustand";

interface ProfileState extends State {
  data: object;
  initialize: (data: any) => void;
}

const useProfileStore: UseStore<ProfileState> = create((set) => ({
  data: {},
  initialize(data) {
    set({
      data: data,
    });
  },
}));

export default useProfileStore;
